const styles = {
  imageCooke: {
    width: 80,
    height: 80,
    objectFit: "contain",
    filter: "brightness(0) invert(1)",
  },

  button: {
    width: 50,
    height: 50,
    border: "none",
    backgroundColor: "transparent",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
};

export default styles;
